import * as React from 'react';
import './CardNews.css';
import {getUsers} from '../../../services/api_services';
import { ReactElement } from 'react';
import { IUser } from '../../../interfaces/IUser';

export interface ICardNewsProps {

}

export default class CardNews extends React.Component<ICardNewsProps> {


  public render() {

    const elementUsers : Array<ReactElement> = ([]);

    getUsers().forEach((e: IUser) => { 
      elementUsers.push(e.name) 
    })

    return (
      <div className='card col py-4 m-2 bg-white teste card-news'>
          <div className=" card-title text-start px-4">
            <h5>Novidades</h5>
            <hr />
          </div>
          {elementUsers}
      </div>
    );
  }
}
